import React, { useEffect, useRef, useState } from 'react';
import './App.css';
import { Designer } from '@pdfme/ui';
import type { Template } from '@pdfme/common';


function App() {
  const containerRef = useRef<HTMLDivElement>(null);
  const designerRef = useRef<Designer | null>(null);
  const [fields, setFields] = useState<any[]>([]);

  useEffect(() => {
    if (containerRef.current) {
      // Define your template for the PDF Designer
      const template: Template = {
        basePdf: 'data:application/pdf;base64,', // Replace with your base PDF data URL
        schemas: [
          {
            name: { type: 'text', position: { x: 0, y: 0 }, width: 50, height: 10 },
            age: { type: 'text', position: { x: 0, y: 20 }, width: 50, height: 10 },
            imageField: {
              type: 'image', // Image field
              position: { x: 10, y: 50 },
              width: 50,
              height: 30,
            },
            qrCodeField: {
              type: 'qr', // QR Code field
              position: { x: 10, y: 90 },
              width: 30,
              height: 30,
            },
          },
          // [
          //   {
          //     name: 'a',
          //     type: 'text',
          //     position: { x: 0, y: 0 },
          //     width: 10,
          //     height: 10,
          //   },
          //   {
          //     name: 'b',
          //     type: 'text',
          //     position: { x: 10, y: 10 },
          //     width: 10,
          //     height: 10,
          //   },
          //   {
          //     name: 'c',
          //     type: 'text',
          //     position: { x: 20, y: 20 },
          //     width: 10,
          //     height: 10,
          //   },
          // ]
        ],
      };

      // Initialize the Designer
      const designer = new Designer({
        domContainer: containerRef.current,
        template,
        options: {
          // labels: {
          //   fieldsList: '', // override the label for the edit button
          //   youCanCreateYourOwnLabel: '', // add a new label for the custom plugin
          // },
        },
      });

      // Store the Designer instance in the ref
      designerRef.current = designer;

      // Optional: Log the initial template fields
      console.log('Initial Template:', designer.getTemplate());

      setFields(template.schemas);

      return () => {
        designer.destroy(); // Clean up the designer instance on unmount
        designerRef.current = null;
      };
    }
  }, []);

  // Function to get all fields from the Designer
  const handleGetAllFields = () => {
    if (designerRef.current) {
      const currentTemplate = designerRef.current.getTemplate();
      setFields(currentTemplate.schemas); // Update state with the latest fields
      console.log('All Template Fields:', currentTemplate.schemas);
    }
  };

  return (
    <div className="App">
      <button onClick={handleGetAllFields} style={{ marginBottom: '20px' }}>
        Get All Template Fields
      </button>
      <div
        ref={containerRef}
        style={{ width: '100%', height: '80vh', border: '1px solid #ccc' }}
      ></div>
      <div style={{ marginTop: '20px' }}>
        <h3>Current Fields:</h3>
        <pre>{JSON.stringify(fields, null, 2)}</pre>
      </div>
    </div>
  );
}
export default App;

